const BPButton = ({
  label,
  onPress,
  marginTop,
  disabled,
  backgroundColor,
  textColor,
  width,
  style,
  loading,
  borderRadius = 5
}) => {
  return (
    <Button
      // style={{
      //   backgroundColor: Colors.primeBG,
      //   color: Colors.primeBG,
      //   border: Colors.buttonBorder
      // }}
      variant="contained"
      color="primary"
    >
      {label}
    </Button>
  );
};

export default BPButton;
